import React from 'react'
import Logo from './img/logo.svg'
import Styles from './Nav.module.css'
import { useNavigate } from 'react-router-dom'

const Nav = () => {
  const navigate = useNavigate()
  const HomeNavigate = () => {
    navigate('/')
  }

  return (
    <div className={Styles['nav-container']}>
      <img
        src={Logo}
        alt='logo'
        onClick={HomeNavigate}
        className={Styles.logo}
      />
      <div className={Styles['nav-decoration']} />
      <div>
        <ul className={Styles['nav-ul']}>
          <NavComponent number='00' name='Home' />
          <NavComponent number='01' name='Destination' />
          <NavComponent number='02' name='Crew' />
          <NavComponent number='03' name='Technology' />
        </ul>
      </div>
    </div>
  )
}

const NavComponent = (props) => {
  return (
    <ul className={Styles['navComponent-ul']}>
      <li className={Styles['navComponent-list-number']}>{props.number}</li>
      <li className={Styles['navComponent-list-name']}> {props.name}</li>
    </ul>
  )
}

export default Nav
